import React from "react";
import './GoalInput.css';
const GoalInput = () => {
  return (
    <form>
      <div className="form-control">
        <label>Enter Goal</label>
        <input type="text" />
      </div>

      <button type="submit">Add Goal</button>
    </form>
  );
};

export default GoalInput;
